import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import { Provider } from 'react-redux';
import store from './redux/store';

function App() {
  return (
    <Provider store = {store}>
      <React.StrictMode>
        <div className="App">
          <Home></Home>
        </div>
        </React.StrictMode>
    </Provider>
  );
}

export default App;
